import './App.css';
import Home from './Components/Home';
import Navbar from './Layout/Navbar'
import Trading from './Components/Trading';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";



function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />



        <Route path="/">
          <Home />
        </Route>

      </div>
    </Router>
  );
}

export default App;
